import { IConsoleOutputDataReducer } from '../Interface/IConsoleOutputDataReducer'
type ActionOutputData = { type: 'changeAllValue', data: { output :{status: number,line: string}, isDisabledWrite: boolean}}

export const ConsoleOutputDataReducer = (state : IConsoleOutputDataReducer,action : ActionOutputData) : IConsoleOutputDataReducer => {
    switch(action.type){
        case 'changeAllValue':
            return {output: [...state.output, action.data.output ], isDisableWrite: action.data.isDisabledWrite}
        default:
            throw new Error();
    }
}
